<!DOCTYPE html>
<html>
  <head>
    <style>
      * {
        padding: 0;
        margin: 0;
        box-sizing: border-box;
        height: 100%;
        border-radius: 10px;
      }

      ::-webkit-scrollbar {
        display: none;
      }
      body {
        -ms-overflow-style: none;
        position: relative;
      }
      #loading {
        width: 100%;
        position: absolute;
        display: flex;
        justify-content: center;
        align-items: center;
        font-weight: bold;
        z-index: 3;
        color: whitesmoke;
        background-color: #303030c3;
      }
      #marker {
        background: red;
        border-radius: 50%;
        height: 10px;
        width: 10px;
        position: absolute;
        top: 50%;
        left: 50%;
      }
      #marker::after {
        content: "";
        border-radius: 50%;
        height: 40px;
        width: 40px;
        position: absolute;
        margin: -15px 0 0 -15px;
        animation: pulsate 1s ease-out;
        animation-iteration-count: infinite;
        opacity: 0;
        box-shadow: 0 0 1px 2px rgba(255, 0, 0, 0.701);
        animation-delay: 1.1s;
      }

      #bgImg {
        position: absolute;
        z-index: -1;
      }

      @keyframes pulsate {
        0% {
          transform: scale(0.1, 0.1);
          opacity: 0;
        }

        50% {
          opacity: 1;
        }

        100% {
          transform: scale(1.2, 1.2);
          opacity: 0;
        }
      }

      @keyframes bounce {
        0% {
          opacity: 0;
          transform: translateY(-2000px) rotate(-45deg);
        }
        60% {
          opacity: 1;
          transform: translateY(30px) rotate(-45deg);
        }
        80% {
          transform: translateY(-10px) rotate(-45deg);
        }
        100% {
          transform: translateY(0) rotate(-45deg);
        }
      }
    </style>
  </head>
  <body id="main">
    <div id="loading">Loading...</div>
    <div id="marker"></div>
    <img id="bgImg" src="/" />
  </body>
